import React from 'react'
import { BrowserRouter } from 'react-router-dom'
import Exercises from '../pages/Exercises'


function App(){

    return(
        <BrowserRouter>
            <Route path="/exercise" component={Exercises}/>
            <Route path="/exercise/new" component={ExercisesNew}/>
        </BrowserRouter>
    ) 

}
export default App
